	<style type="text/css">
		.btnClass:hover {
			cursor: pointer;
			position: absolute;
			left: 654px ! important;
		}

		body, h2, p {
			margin: 0;
			padding: 0;
		}


		#book {
		/*	background: url("book.png") no-repeat;*/
			position: absolute;
			width: 670px;
			height: 525px;
			left: 190px;
			cursor: pointer;
			z-index: 0;
		/*	top: 50%;
			margin-left: -400px;
			margin-top: -125px;*/
		}

		#pages section {
/*			background: url("assets/bgMain.png") no-repeat;*/
			background-color: #FFF;	
			display: block;
			width: 430px;
			height: 490px;
			position: absolute;
			left: 210px;
			top: 20px;
			overflow: hidden;
		}

		#pages section>div {
			display: block;
			width: 480px;
			height: 525px;
			font-size: 12px;
		}
		#pages section p,
		#pages section h2 {
			padding: 3px 35px;
			line-height: 1.4em;
			text-align: justify;
		}
		#pages section h2{
			margin: 15px 0 10px;
		}

		#pageflip-canvas {
			position: absolute;
			z-index: -100;
		}

	  .blink {
        animation: blinker 2s linear infinite;
    
      }
      @keyframes blinker {
        50% {
          opacity: 0;
        }
      }

	</style>

	function main(){
		//setTimeout(pageOneView, 3000);
		document.getElementById("videoSource").src = videoData;	
		document.getElementById("menuSelSource").src = menuSelData;
		//setTimeout(toggleMute,3000);

		document.getElementById("pageSection1").style.display = "";
		document.getElementById("pageSection2").style.display = "";
		document.getElementById("pageSection3").style.display = "";
		document.getElementById("pageSection4").style.display = "";
		document.getElementById("pageSection5").style.display = "";
		document.getElementById("pageSection6").style.display = "";

		
		//document.getElementById("xx").value="ffffffffffffffffffffffffffffffffffffff";

		//setTimeout(toggleMute, 3000);
	}
	
	// Dimensions of the whole book<in
	var BOOK_WIDTH = 670;
	var BOOK_HEIGHT = 525;
	var thisEvent;
	// Dimensions of one page in the book
	var PAGE_WIDTH = 450;
	var PAGE_HEIGHT = 525;
	
	// Vertical spacing between the top edge of the book and the papers
	var PAGE_Y = ( BOOK_HEIGHT - PAGE_HEIGHT ) / 2;
	
	// The canvas size equals to the book dimensions + this padding
	var CANVAS_PADDING = 0;
	
	var page = 0;
	
	var canvas = document.getElementById( "pageflip-canvas" );
	var context = canvas.getContext( "2d" );
	
	var mouse = { x: 0, y: 0 };
	
	var flips = [];
	
	var book = document.getElementById( "book" );
	
	// List of all the page elements in the DOM
	var pages = book.getElementsByTagName( "section" );
	
	// Organize the depth of our pages and create the flip definitions
	for( var i = 0, len = pages.length; i < len; i++ ) {
		pages[i].style.zIndex = len - i;
		
		flips.push( {
			// Current progress of the flip (left -1 to right +1)
			progress: 1,
			// The target value towards which progress is always moving
			target: 1,
			// The page DOM element related to this flip
			page: pages[i], 
			// True while the page is being dragged
			dragging: false
		} );
	}
	
	// Resize the canvas to match the book size
	canvas.width = BOOK_WIDTH + ( CANVAS_PADDING * 2 );
	canvas.height = BOOK_HEIGHT + ( CANVAS_PADDING * 2 );
	
	// Offset the canvas so that it's padding is evenly spread around the book
	canvas.style.top = -CANVAS_PADDING + "px";
	canvas.style.left = -CANVAS_PADDING + "px";
	
	// Render the page flip 60 times a second
	setInterval( render, 1000 / 60 );
	

	var beforeSel = -1;


	function pageSel(sel){		

	//	alert("sdfsdfsd");

		document.getElementById("mark").style.top = '150px';
		document.getElementById("mark").style.left = '40px';
		document.getElementById("mark").style.transform = 'rotate(0deg)';
		//document.getElementById("mark").left = 'position: absolute; left: 40px; top: 150px;';

		document.getElementById("pageflip-canvas").style = "z-index:999999";

		if(sel > page){
			
			
			for( var i = 0; i < sel; i++ ) {

				flips[i].dragging = true;	
				flips[i].target = -1;
				page = i;
				flips[i].dragging = false;	
			
			}

		}else{

			for( var i = page; i >= sel; i-- ) {

				flips[i].dragging = true;	
				flips[i].target = 1;
				page = i;
				flips[i].dragging = false;	
			
			}

		}
		if(sel == 1){
			document.getElementById("pageflip-canvas").style = "z-index:-100";
			
			var x = document.getElementById("myvideo");
			x.autoplay = true;

			x.load();

		}else{
			document.getElementById("pageflip-canvas").style = "z-index:-100";
			
			var x = document.getElementById("myvideo");
			
			x.pause();
		}

		var index = 0;

		for(i = sel; i < 6; i++){
			
			index++;
			
			document.getElementById("btn"+i).style.zIndex = parseInt(10 + index) * -1;
			document.getElementById("btn"+i).style.top = parseInt(50 * (index - 1))+"px";
		}

		
		i = 0;

		for(i = 0; i < sel; i++){
			
			index++;
			
			document.getElementById("btn"+i).style.zIndex = parseInt(10 + index) * -1;
			document.getElementById("btn"+i).style.top = parseInt(50 * (index - 1))+"px";

			
		}
		var x = document.getElementById("menuSelected");
		x.autoplay = true;
		x.load();
		
	}

	function toggleMute() {
		
		

		pageSel(1);
	}	

	function btnOver(){
		
		
		var x = document.getElementById("menuVisited");//videoSource
		x.autoplay = true;
		x.load();
	}

	function render() {
		

		context.clearRect( 0, 0, canvas.width, canvas.height );
		
		for( var i = 0, len = flips.length; i < len; i++ ) {
			var flip = flips[i];
			
			if( flip.dragging ) {
				flip.target = Math.max( Math.min( mouse.x / PAGE_WIDTH, 1 ), -1 );
			}
			
			// Ease progress towards the target value 
			flip.progress += ( flip.target - flip.progress ) * 0.2;
			
			// If the flip is being dragged or is somewhere in the middle of the book, render it
			if( flip.dragging || Math.abs( flip.progress ) < 0.997 ) {
				drawFlip( flip );
			}
			
		}
		
	}
	
	function drawFlip( flip ) {
		// Strength of the fold is strongest in the middle of the book
		var strength = 1 - Math.abs( flip.progress );
		
		// Width of the folded paper
		var foldWidth = ( PAGE_WIDTH * 0.5 ) * ( 1 - flip.progress );
		
		// X position of the folded paper
		var foldX = PAGE_WIDTH * flip.progress + foldWidth;
		
		// How far the page should outdent vertically due to perspective
		var verticalOutdent = 20 * strength;
		
		// The maximum width of the left and right side shadows
		var paperShadowWidth = ( PAGE_WIDTH * 0.5 ) * Math.max( Math.min( 1 - flip.progress, 0.5 ), 0 );
		var rightShadowWidth = ( PAGE_WIDTH * 0.5 ) * Math.max( Math.min( strength, 0.5 ), 0 );
		var leftShadowWidth = ( PAGE_WIDTH * 0.5 ) * Math.max( Math.min( strength, 0.5 ), 0 );
		
		
		// Change page element width to match the x position of the fold
		flip.page.style.width = Math.max(foldX, 0) + "px";
		
		context.save();
		context.translate( CANVAS_PADDING + ( BOOK_WIDTH / 2 ), PAGE_Y + CANVAS_PADDING );
		
		
		// Draw a sharp shadow on the left side of the page
		context.strokeStyle = 'rgba(0,0,0,'+(0.05 * strength)+')';
		context.lineWidth = 30 * strength;
		context.beginPath();
		context.moveTo(foldX - foldWidth, -verticalOutdent * 0.5);
		context.lineTo(foldX - foldWidth, PAGE_HEIGHT + (verticalOutdent * 0.5));
		context.stroke();
		
		
		// Right side drop shadow
		var rightShadowGradient = context.createLinearGradient(foldX, 0, foldX + rightShadowWidth, 0);
		rightShadowGradient.addColorStop(0, 'rgba(0,0,0,'+(strength*0.2)+')');
		rightShadowGradient.addColorStop(0.8, 'rgba(0,0,0,0.0)');
		
		context.fillStyle = rightShadowGradient;
		context.beginPath();
		context.moveTo(foldX, 0);
		context.lineTo(foldX + rightShadowWidth, 0);
		context.lineTo(foldX + rightShadowWidth, PAGE_HEIGHT);
		context.lineTo(foldX, PAGE_HEIGHT);
		context.fill();
		
		
		// Left side drop shadow
		var leftShadowGradient = context.createLinearGradient(foldX - foldWidth - leftShadowWidth, 0, foldX - foldWidth, 0);
		leftShadowGradient.addColorStop(0, 'rgba(0,0,0,0.0)');
		leftShadowGradient.addColorStop(1, 'rgba(0,0,0,'+(strength*0.15)+')');
		
		context.fillStyle = leftShadowGradient;
		context.beginPath();
		context.moveTo(foldX - foldWidth - leftShadowWidth, 0);
		context.lineTo(foldX - foldWidth, 0);
		context.lineTo(foldX - foldWidth, PAGE_HEIGHT);
		context.lineTo(foldX - foldWidth - leftShadowWidth, PAGE_HEIGHT);
		context.fill();
		
		
		// Gradient applied to the folded paper (highlights & shadows)
		var foldGradient = context.createLinearGradient(foldX - paperShadowWidth, 0, foldX, 0);
		foldGradient.addColorStop(0.35, '#fafafa');
		foldGradient.addColorStop(0.73, '#eeeeee');
		foldGradient.addColorStop(0.9, '#fafafa');
		foldGradient.addColorStop(1.0, '#e2e2e2');
		
		context.fillStyle = foldGradient;
		context.strokeStyle = 'rgba(0,0,0,0.06)';
		context.lineWidth = 0.5;
		
		// Draw the folded piece of paper
		context.beginPath();
		context.moveTo(foldX, 0);
		context.lineTo(foldX, PAGE_HEIGHT);
		context.quadraticCurveTo(foldX, PAGE_HEIGHT + (verticalOutdent * 2), foldX - foldWidth, PAGE_HEIGHT + verticalOutdent);
		context.lineTo(foldX - foldWidth, -verticalOutdent);
		context.quadraticCurveTo(foldX, -verticalOutdent * 2, foldX, 0);
		
		context.fill();
		context.stroke();
		
		
		context.restore();
	}
